#include <iostream>
#include <vector>
#include <unordered_map>
using namespace std;

string minWindow(string s, string t) {
    if (s.size() < t.size()) {
        return "";
    }

    vector <int> mapped(65, 1e9);

    for (auto i: t) {
        if (mapped[i - 'A'] == 1e9) {
            mapped[i - 'A'] = 0;
        }
        mapped[i - 'A']++;   
    }

    int nonzeroes = 0;
    for (int i = 0; i < mapped.size(); i++) {
        if (mapped[i] != 1e9) {
            nonzeroes++;
        }
    }

    for (int i = 0; i < t.size(); i++) {
        if (mapped[s[i] - 'A'] != 1e9) {
            mapped[s[i] - 'A']--;
            if (mapped[s[i] - 'A'] == 0) {
                nonzeroes--;
            }
        }
    }

    string ans = s;
    int check = 0;


    int low = 0;
    int high = t.size() - 1;
    while (high < s.size() && (high - low >= t.size() - 1 || nonzeroes > 0)) {
        if (nonzeroes == 0) {
            while (true) {
                if (ans.size() >= high - low + 1) {
                    check = 1;
                    ans = s.substr(low, high - low + 1);
                }
                
                if (mapped[s[low] - 'A'] != 1e9) {
                    if (mapped[s[low] - 'A'] == 0) {
                        nonzeroes++;
                    }

                    mapped[s[low] - 'A']++;

                    if (nonzeroes > 0) {
                        low++;
                        break;
                    }
                }
                low++;
            }
        } else {
            while (true) {
                high++;
                if (high >= s.size() && nonzeroes != 0) {
                    break;
                }

                if (mapped[s[high] - 'A'] != 1e9) {
                    mapped[s[high] - 'A']--;
                    if (mapped[s[high] - 'A'] == 0) {
                        nonzeroes--;
                    }
                    if (nonzeroes == 0) {
                        break;
                    }
                }
            }
        }
    }

    if (check) {
        return ans;
    } else {
        return "";
    }
}

